def sum(a):
    n = 0
    ans = 0
    res = a
    a = a.replace('[', '')
    a = a.replace(']', '')
    nums = a.split(',')
    b = res
    j = 0
    for i in range(len(b)):
        if b[i] == '[':
            n += 1
        elif b[i] == ']':
            n -= 1
        elif b[i] == ',':
            continue
        elif b[i+1] == ',' or b[i+1] == ']':
            ans += int(nums[j]) * n
            j += 1
    return ans

